import React from "react";
import "./CatalogCard.css";

function CatalogCard({ title, link, phone, country, prise ,size}) {
    return (
        <div className="card" style={{ width: "18rem" }}>
            <div className="card-body">
                <h4 className="card-title title">{title}</h4>
                <div className="img-continer">
                    <img
                        src={"https://picsum.photos/300"}
                        alt={title + "img"}
                        class="card-image"
                    />
                </div>
<div className="product-info">
<p className="card-text phone"><strong>Tel:</strong>  {phone}</p>
                <p className="card-text country"><strong>Made in {country}</strong></p>
                <p className="price"><strong>Price: </strong>{prise}</p>
                <p className="size"><strong>Size: </strong>{size}</p>
</div>
               
            </div>
        </div>
    );
}

export default CatalogCard;
